import React, { useEffect, useState } from "react";
// import { useParams } from "react-router-dom";
import Header from "../header/header";
import Footer from "../footer/Footer";
import "./Product.css";
import Basket from "../myBasket/basket";

const Product = () => {
  const [basketItems, setBasketItems] = useState([
    {
      id: 1,
      name: "Royal Cheese Burger",
      description: "With extra fries",
      price: 120,
      quantity: 1,
    },
    {
      id: 2,
      name: "Potato Veggies",
      description: "No Mushrooms + green peppers",
      price: 70,
      quantity: 1,
    },
    {
      id: 3,
      name: "Coke Coca Cola",
      description: "",
      price: 40,
      quantity: 1,
    },
  ]);

  // if (loading) return <p>Loading...</p>;
  // if (!product) return <p>Product not found.</p>;


  const handleCopyLink = () => {
    navigator.clipboard.writeText("Your link here!");
    alert("Link copied to clipboard!");
  };



  const handleAddToCart = (newItem) => {
    // Check if the item already exists in the basket
    const itemIndex = basketItems.findIndex((item) => item.id === newItem.id);

    if (itemIndex >= 0) {
      // If item exists, update its quantity
      const updatedItems = [...basketItems];
      updatedItems[itemIndex].quantity += 1;
      setBasketItems(updatedItems);
    } else {
      // If item doesn't exist, add it to the basket
      setBasketItems([...basketItems, { ...newItem, quantity: 1 }]);
    }
  };

  return (
    <div>
      <Header />



      {/* Main Banner */}
